window.bookSummaryJSON = "<p>Anakin Skywalker knows that Obi-Wan Kenobi did not choose him as an apprentice. Instead, it was teh dying wish of Obi-Wan's own Master, Qui-Gon Jinn, that brought them together. Now, Anakin is beginning to doubt his Master's commitment....and Obi-Wan is starting to wonder if he will ever be as good a Master as qui-Gon.</p> <p>With these things in mind, Master and apprentice head out on a training exercise that soon turns into a struggle to survive. A squad of bounty hunters has been hired to capture the Jedi - and they will stop at nothing to do it. Anakin and Obi-Wan must avoid the traps and ambushes...and try to discover who is behind the deadly Jedi hunt.</p> <p>Set between Episode I and Episode II, the Jedi Quest series traces the emergence and education of Anakin Skywalker as a young Jedi devoted to the Force -- and tempted by its dark side.</p>"; 
